INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "キャル", 1, 0.0, "2015/12/17 15:00:00", 0.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 106001, 7001, 0, 7);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "コッコロ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 105901, 7002, 0, 7);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "ペコリーヌ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 105801, 7003, 0, 7);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "ペコリーヌ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 105801, 10001, 0, 10);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "キャル", 1, 0.0, "2015/12/17 15:00:00", 0.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 106001, 10002, 0, 10);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "コッコロ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 105901, 10003, 0, 10);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "シェフィ", 2, 0.0, "2015/12/17 15:00:00", 0.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 106401, 10004, 2104010, 10);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -416.5, 0, "2030/12/17 14:59:59", 1, "ペコリーヌ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 105801, 12001, 0, 12);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "キャル", 1, 0.0, "2015/12/17 15:00:00", 0.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 106001, 13001, 0, 13);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "コッコロ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 105901, 13002, 0, 13);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "シェフィ", 2, 0.0, "2015/12/17 15:00:00", 0.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 106401, 13003, 2104010, 13);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "ペコリーヌ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 105801, 13004, 0, 13);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "コッコロ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 105901, 14001, 0, 14);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "シェフィ", 2, 0.0, "2015/12/17 15:00:00", 0.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 106401, 14002, 2104010, 14);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "ペコリーヌ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 105801, 14003, 0, 14);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "キャル", 1, 0.0, "2015/12/17 15:00:00", 0.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 106001, 14004, 0, 14);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -470.0, 0, "2030/12/17 14:59:59", 1, "コッコロ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 105901, 15001, 0, 15);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "シェフィ", 2, 0.0, "2015/12/17 15:00:00", 0.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 106401, 16001, 2104010, 16);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "ペコリーヌ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 105801, 16002, 0, 16);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "キャル", 1, 0.0, "2015/12/17 15:00:00", 0.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 106001, 16003, 0, 16);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "コッコロ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 105901, 16004, 0, 16);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "コッコロ", 1, 0.0, "2015/12/17 15:00:00", 0.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 105901, 17002, 0, 17);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "キャル", 1, 0.0, "2015/12/17 15:00:00", 0.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 106001, 17004, 0, 25);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "コッコロ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 105901, 17005, 0, 25);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "シェフィ", 2, 0.0, "2015/12/17 15:00:00", 0.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 106401, 17006, 2104010, 25);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "ペコリーヌ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 105801, 17007, 0, 25);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "カリン", 1, 0.0, "2015/12/17 15:00:00", 0.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 190801, 18001, 0, 18);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 2, "カリン", 1, 0.0, "2015/12/17 15:00:00", 0.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 190801, 18002, 0, 18);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -470.0, 0, "2030/12/17 14:59:59", 3, "カリン", 1, 0.0, "2015/12/17 15:00:00", 0.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 190801, 19001, 0, 19);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -470.0, 0, "2030/12/17 14:59:59", 4, "カリン", 1, 0.0, "2015/12/17 15:00:00", 0.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 190801, 19002, 0, 19);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -470.0, 0, "2030/12/17 14:59:59", 5, "カリン", 1, 0.0, "2015/12/17 15:00:00", 0.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 190801, 20001, 0, 20);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -470.0, 0, "2030/12/17 14:59:59", 6, "カリン", 1, 0.0, "2015/12/17 15:00:00", 0.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 190801, 20002, 0, 20);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "キャル", 1, 0.0, "2015/12/17 15:00:00", 0.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 106001, 21001, 0, 21);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "コッコロ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 105901, 21002, 0, 21);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "シェフィ", 2, 0.0, "2015/12/17 15:00:00", 0.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 106401, 21003, 2104010, 21);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "ペコリーヌ", 1, 0.0, "2015/12/17 15:00:00", 0.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 105801, 21004, 0, 21);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -430.0, 0, "2030/12/17 14:59:59", 1, "カリン", 1, 0.0, "2015/12/17 15:00:00", 0.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 190801, 22001, 0, 22);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -430.0, 0, "2030/12/17 14:59:59", 2, "カリン", 1, 0.0, "2015/12/17 15:00:00", 0.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 190801, 22002, 0, 22);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -430.0, 0, "2030/12/17 14:59:59", 3, "カリン", 1, 0.0, "2015/12/17 15:00:00", 0.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 190801, 23001, 0, 23);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -430.0, 0, "2030/12/17 14:59:59", 4, "カリン", 1, 0.0, "2015/12/17 15:00:00", 0.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 190801, 23002, 0, 23);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, -385.0, 10011, "2030/12/17 14:59:59", 1, "エリコ（バレンタイン）", 1, 8.0, "2019/01/31 12:00:00", 4.08, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 109001, 24001, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, -385.0, 10011, "2030/12/17 14:59:59", 2, "エリコ（バレンタイン）", 1, 8.0, "2019/01/31 12:00:00", 5.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 109001, 24002, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, -385.0, 10011, "2030/12/17 14:59:59", 3, "エリコ（バレンタイン）", 1, 8.0, "2019/01/31 12:00:00", 10.11, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 109001, 24003, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, -385.0, 10011, "2030/12/17 14:59:59", 4, "エリコ（バレンタイン）", 1, 8.0, "2019/01/31 12:00:00", 4.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 109001, 24004, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, -385.0, 10011, "2030/12/17 14:59:59", 5, "エリコ（バレンタイン）", 1, 8.0, "2019/01/31 12:00:00", 6.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 109001, 24005, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0.0, 10011, "2030/12/17 14:59:59", 6, "エリコ（バレンタイン）", 1, 0.0, "2019/01/31 12:00:00", 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 109002, 24006, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0.0, 10011, "2030/12/17 14:59:59", 7, "エリコ（バレンタイン）", 1, 0.0, "2019/01/31 12:00:00", 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 109002, 24007, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0.0, 10011, "2030/12/17 14:59:59", 8, "エリコ（バレンタイン）", 1, 0.0, "2019/01/31 12:00:00", 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 109002, 24008, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0.0, 10011, "2030/12/17 14:59:59", 9, "エリコ（バレンタイン）", 1, 0.0, "2019/01/31 12:00:00", 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 109002, 24009, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0.0, 10011, "2030/12/17 14:59:59", 10, "エリコ（バレンタイン）", 1, 0.0, "2019/01/31 12:00:00", 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 109002, 24010, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, -385.0, 10011, "2030/12/17 14:59:59", 1, "シズル（バレンタイン）", 1, 8.0, "2019/01/31 12:00:00", 2.12, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 109101, 24011, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, -385.0, 10011, "2030/12/17 14:59:59", 2, "シズル（バレンタイン）", 5, 8.0, "2019/01/31 12:00:00", 4.19, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 109101, 24012, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (4, -385.0, 10011, "2030/12/17 14:59:59", 3, "シズル（バレンタイン）", 2, 8.0, "2019/01/31 12:00:00", 2.3, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 109101, 24013, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0.0, 10011, "2030/12/17 14:59:59", 4, "シズル（バレンタイン）", 1, 0.0, "2019/01/31 12:00:00", 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 109102, 24014, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, -385.0, 10011, "2030/12/17 14:59:59", 5, "シズル（バレンタイン）", 5, 8.0, "2019/01/31 12:00:00", 5.23, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 109101, 24015, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0.0, 10011, "2030/12/17 14:59:59", 6, "シズル（バレンタイン）", 1, 0.0, "2019/01/31 12:00:00", 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 109102, 24016, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, -385.0, 10011, "2030/12/17 14:59:59", 7, "シズル（バレンタイン）", 1, 8.0, "2019/01/31 12:00:00", 5.01, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 109101, 24017, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0.0, 10011, "2030/12/17 14:59:59", 8, "シズル（バレンタイン）", 1, 0.0, "2019/01/31 12:00:00", 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 109102, 24018, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0.0, 10011, "2030/12/17 14:59:59", 9, "シズル（バレンタイン）", 1, 0.0, "2019/01/31 12:00:00", 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 109102, 24019, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0.0, 10011, "2030/12/17 14:59:59", 10, "シズル（バレンタイン）", 1, 0.0, "2019/01/31 12:00:00", 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 109102, 24020, 0, 24);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "シェフィ", 2, 0.0, "2015/12/17 15:00:00", 0.0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 106401, 26001, 2104010, 26);
