INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, -363.0, 0, "2030/12/17 14:59:59", 1, "キャル", 1, 0.0, "2015/12/17 15:00:00", 0.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 106001, 43003, 0, 43);
